import React from 'react'

class EventList extends React.Component {
    state = {employees: [], error: ''}
    componentDidMount() {
        // This is a react life cycle hook method, will be called once component is successfully loaded
        var url = "http://localhost:3001/employees/"
        fetch(url)
        .then(response => response.json())
        .then(response => this.setState({employees:response}))
        .catch(error => this.setState({error:error}))}
    render() {
        return <div>
            <h1>Employees List</h1>
            <table border = "1">
                <th>ID</th><th>Employee Name</th><th>Salary</th><th>Job</th>
                {this.state.employees.map(e => 
                <tr>
                    <td>{e.id}</td><td>{e.ename}</td><td>{e.salary}</td><td>{e.job}</td>
                </tr>)}
            </table>
            {this.state.error}
        </div>
    }
}

export default EventList
